import React from 'react';

export default function index() {
	return (
		<div className="section">
			<div className="container">
				<article className="message">
					<div className="message-header is-centered">
						<p className='title has-text-white'>Introduction</p>

					</div>
					<div className="message-body">
						I am Nzubechukwu Nnamani, a fullstack software engineer with special taste for anything javascript for breakfast, python for lunch and asp.net for dessert...jus
					</div>
				</article>
			</div>
		</div>
	);
}
